--
-- Table structure for `target`
--

DROP TABLE IF EXISTS `target`;
CREATE TABLE `target` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `college_id` bigint DEFAULT NULL,
  `course_code` bigint NOT NULL,
  `department_id` bigint DEFAULT NULL,
  `grade1` bit(1) NOT NULL,
  `grade2` bit(1) NOT NULL,
  `grade3` bit(1) NOT NULL,
  `grade4` bit(1) NOT NULL,
  `grade5` bit(1) NOT NULL,
  `is_denied` bit(1) NOT NULL,
  `is_strict` bit(1) NOT NULL,
  `scope_type` tinyint NOT NULL,
  `student_type` tinyint NOT NULL,
  PRIMARY KEY (`id`),
  CONSTRAINT `target_chk_1` CHECK ((`scope_type` between 0 and 2)),
  CONSTRAINT `target_chk_2` CHECK ((`student_type` between 0 and 3))
) ENGINE=InnoDB AUTO_INCREMENT=4886 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

